offers.description:
Авто во владении почти 5 лет, второй владелец. Куплен с пробегом примерно 70.000 км.
Машина все время находилась в Краснодарском крае, кузов не гнилой. В обслуживании не дороже ВАЗа, запчасти можно любые найти, цены приемлимы.

За время владения, помимо регулярного ТО каждые 6-8 тысяч км (фильтры, масло, свечи) было заменено/доработано:
-радиатор основной (подтекал) и радиатор печки;
-вентилятор кондиционера (поставил большего диаметра);
-сальник первичного вала КПП (потек) + подшипник;
-комплект сцепления с проточкой маховика, главный цилиндр сцепления;
-перебрали ГБЦ с заменой прокладки;
-ремонт генератора (замена диодного моста и щеток);
- замена ГРМ со всеми роликами и помпой на 130.000 км.

Оптика:
-заменены линзы в фарах;
-возле фар поставлено разгрузочное реле;
-отполированы передние и задние фары и оклеены защитной полиуретановой пленкой;
-маски внутри передних фар окрашены в черный;
-штатные туманки заменены на линзованные с ксеноном;
-установлены ДХО. 

Апгрейд:
-стоит доработанная китайская 2din магнитола (без нареканий в работе): 2 пульта ДУ;
-установлен комплект PIONEER (пассивный сабвуфер и усилитель);
-установлены динамики в задние двери (делал сам и такого не у кого больше не видел);
-камеры переднего и заднего вида;
-сигнализация StarLine A91 с автозапуском и двумя брелками; два родных ключа от авто;
-сделана полная шумоизоляция премиальными материалами фирмы "ШумOFF" (занимаюсь автозвуком, шумоизоляцией и допоборудованием уже 8 лет);
-переделаны передние сиденья: добавлена боковая поддержка и устранены разрывы в штатном наполнителе 3 года назад;
-задний полукруг тонирован 5%, передние боковые в атермалке; установлены дефлекторы окон;
-сзади в пружинах установлены автобафферы;
-недавно куплен новый АКБ VARTA с гарантией 2года;
-второй комплект свежей зимней резины на дисках K&K (+гайки).


В прошлом году переехали в Москву. Почти сразу сделал антикор подкрылок, передних крыльев и под задним бампером (BODY 930). Ездили только по 

выходным до магазина. Зимой была практически без эксплуатации. 
Машина в заводской краске, все детали родные. В августе 2019 было незначительное дтп (в пробке сзади уперлись): слегка помята крышка багажника и 

паутинка на бампере (на фото все видно).
На кузове присутствуют следы эксплуатации, характерные для своего возраста.
Перед продажей сделал сам легкую химчистку салона. Авто в хорошем состоянии, срочных ремонтов не требуется. 
Отвечу на все вопросы по телефону - звоните с 10:00 до 21:00. 
Бортжурнал на Drive2.ru — https://www.drive2.ru/r/faw/vita/506245391071577104/
